import { Fragment, useState } from "react";
import Iphone from "./components/Iphone";

function App() {

  const [products, setProducts] = useState([])

  async function getPhones() {

    await fetch('https://dummyjson.com/products').then(response => {
      return response.json()}).then((data) => {

        const transformedPhone = data.results.map(
          productsData => {
            return {
              id: productsData.id,
              title: productsData.title,
              description: productsData.description,
              price: productsData.price,
              brand: productsData.brand
            }
          }
        )


        setProducts(transformedPhone)})
  }


  return (
    <Fragment>
      <section>
      <button onClick={getPhones}>GET ALL PRODUCTS</button>
      </section>
      <section>
        <Iphone products={products}/>
      </section>
    </Fragment>
  );
}


export default App;
